In this visually-stunning sexy spoof of the cult classic, Tron, and its modern high-tech sequel, the real world collides with the Grid, and it's a tech-geek's wet dream! When Kevin Fling is fired from his job as a pleasure product engineer, he decides to hack into the Enrection computer system. But, he gets more than he bargains for. Sucked into the Computer System, Kevin goes on an exciting journey through a world of beautiful &amp; horny programs, busty software, fast &amp; dangerous &quot;Light-Suckles&quot;, and glowing vaginas, to take on the evil &amp; powerful Masturbation Control Program.
